k\r\n - czshare.com	             - load.to	                 - tinyurl.com\r\n - czshare.com_profi	     - mediafire.com	         - ugotfile.com\r\n - dataup.de	             - megaupload.com	         - uloz.cz\r\n - depositfiles.com	         - myurl.in	                 - uloz.to\r\n - disperseit.com	         - nahraj.cz	             - ulozisko.sk\r\n - easyshare.com	         - netgull.com	             - ultrashare.net\r\n - edisk.cz	                 - netload.in	             - uploadbox.com\r\n - egoshare.com	             - o2musicstream.cz	         - uploaded.to\r\n - enterupload.com	         - paid4share.com	         - uploading.com\r\n - filebase.to	             - plunder.com	             - uploadjockey.com\r\n - filefactory.com	         - przeklej.pl	             - upnito.sk\r\n - fileflyer.com	         - quickshare.cz	         - uppit.com\r\n - filesend.net	             - radikal.ru	             - usercash.com\r\n - fileupload.eu	         - RapidShare.com	         - webshare.net\r\n - flyshare.cz	             - RapidShare.com_premium	 - wiiupload.net\r\n - hellshare.com	         - rapidshare.de	         - wikiupload.com\r\n - hellshare.com_full	     - rapidshareuser	         - xtraupload.de\r\n - hotfile.com	             - rsmonkey.com	             - yourfiles.biz\r\n - ifile.it	                 - savefile.com	             - youtube.com\r\n - imagebam.com	             - saveqube.com	             - ziddu.com\r\n - imagehaven.net	         - sdilej.to	             - zippyshare.com\r\n - indowebster.com	         - sendspace.com	         - zshare.net\r\n - iskladka.cz	             - sendspacepl.pl\r\n\r\n\r\n II.    Requisitos del sistema\r\n=======================================\r\n\r\nConfiguraci?n recomendada:\r\n    * Windows 2000/XP/Linux(core 2.4)* o posterior\r\n    * Procesador Pentium 800MHz \r\n    * resoluci?n m?nima 1024x768 \r\n    * 40 MB de memoria RAM\r\n    * 10 MB de espacio libre en el disco \r\n    * Java 2 Platform - version 1.6 (Java SE 6 Runtime) \r\n\r\nla aplicaci?n necesita por lo menos Sun Java 6.0 para funcionar (http://java.sun.com/javase/downloads/index.jsp , JRE 6)\r\n\r\n\r\nIII.   C?mo ejecutar FreeRapid Downloader\r\n=========================--==============\r\n\r\nInstalaci?n\r\n------------\r\nDescomprima los archivos a cualquier directorio, pero cuidado con caracteres especiales (como  \'+\' o \'!\') en la ruta\r\nsi hace una actualizaci?n a una versi?n posterior, puede eliminar la carpeta anterior todas las configuraciones se \r\nalmacenan en su directorio personal.\r\nMS Windows: c:\\Documents and Settings\\SU_NOMBRE_DE_USUARIO\\application data\\VitySoft\\FRD\r\n\r\nLinux: ~/.FRD\r\n\r\nNO COPIE UNA NUEVA VERSION A LA CARPETA DONDE ESTA UNA VERSION ANTERIOR\r\n\r\nEjecuci?n\r\n-----------\r\nWindows\r\n Simplemente ejecute frd.exe\r\n\r\nLinux\r\n Ejecute el comando ./frd.sh\r\n\r\nTodas las plataformas\r\n Ejecute el comando: java -jar frd.jar\r\n\r\npar?mentros adicionales para ejecutar:\r\n\r\njava -jar frd.jar [-h -v -d -D<propiedad>=<valor>\r\n\r\n\r\nopciones\r\n  -h (--help,-?)      muestra este mensaje\r\n  -v (--version)      muestra la informaci?n de la versi?n y termina\r\n  -d (--debug)        muestra informaci?n de depuraci?n  \r\n  -r (--reset)        reinicia las propiedades de los usuarios a sus valores por defecto\r\n  -m (--minim)        minimiza la ventana principal al iniciar \r\n  -Dproperty=value    Pasa la propiedad y su valor a la aplicaci?n (frecuentemente para prop?sitos de depuraci?n)\r\n\r\nSi el valor de la propiedad -D es determinada como \'default\' (sin \') se usar? el valor por defecto.\r\n\r\nejemplo - ejecuci?n de la aplicaci?n en modo de depuraci?n\r\n  Windows : frd.exe --debug\r\n  Linux/MacOS: java -jar frd.jar --debug\r\n\r\n\r\nMa?s Informaci?n:\r\n  - Tutorial no oficial para usuarios - c?mo configurar FreeRapid Downloader en Linux (en espa?ol)\r\n    http://manualinux.my-place.us/freerapid.html\r\n\r\n\r\n    \r\nIV.    Errores conocidos y limitaciones\r\n========================================\r\n- La aplicaci?n no iniciar? si est? localizada en una ruta con caracteres especiales, como \"+\" o \"%\"\r\n   X Por favor, mueva la aplicaci?n a otra ubicaci?n sin tales caracteres\r\n- ESET \"Smart\" Antivirus bloquea, en Windows, el inicio de la aplicaci?n\r\n   X Corrija las configuraciones de su programa antivirus o ejecute el antivirus con la opci?n: frd.exe -Doneinstance=false\r\n- Siempre cierre FRD apropiadamente, o puede perder su lista de archivos (ejemplo: apagar forzadamente Windows)\r\n- Seleccionar, desde el final hasta el principio de la lista, en la ventana principal mientras descarga parcialmente \r\n  desaparece :-(\r\n   X seleccione la fila de la tabla haciendo ctrl+click del rat?n o seleccione los ?tems desde el inicio hasta el final\r\n- El tema Substance lanza una excepci?n org.jvnet.substance.api.UiThreadingViolationException:\r\n						Component creation must be done on Event Dispatch Thread\r\n   X ignore esta excepci?n en el app.log\r\n- java.lang.UnsupportedClassVersionError exception\r\n    X usted est? usando una versi?n antigua de java, debe usar la versi?n 6 o posterior\r\n- DirectoryChooser lanza java.lang.InternalError o se congela en Windows Vista (64bit)\r\n    X ignore esta excepci?n en el app.log\r\n- java.lang.ClassCastException: java.awt.TrayIcon cannot be cast to java.awt.Component\r\n    X ignore esta excepci?n en el app.log\r\n- Usuarios de linux informan que no se est? mostrando un icono en la bandeja\r\n    X la ?nica soluci?n para este problema podr?a ser una actualizaci?n del JRE a la version 1.6.0_10-rc o posterior\r\n\r\nV.    Solucionando Problemas\r\n=======================================\r\n1. Revise la secci?n IV - por alg?n error conocido o limitaci?n\r\n2. ?Ha intentado salir de la aplicaci?n y volver a entrar? :)\r\n3. Revise la p?gina http://wordrider.net/freerapid y/o el seguimiento de errores en http://bugtracker.wordrider.net/\r\n   por un posible nuevo error conocido.\r\n4. Puede intentar eliminar los archivos de configuraci?n (su ubicaci?n est? descrita en la secci?n VI -  Instalaci?n )  \r\n5. Ejecute la aplicaci?n en modo de depuraci?n\r\n   Windows OS: frd.exe --debug\r\n   Linux/MacOS: java -jar frd.jar --debug\r\n6. Informe el problema con el app.log como es descrito en la secci?n VI\r\n\r\n\r\nVI.    Informe de errores\r\n=======================================\r\nSi usted encuentra alg?n error en la aplicaci?n, por favor, no asuma que ya lo s?, h?gamelo saber tan pronto sea posible\r\npara solucionarlo antes de la pr?xima liberaci?n, ya que mis recursos son limitados, no puedo hacer correcciones de errores\r\na versiones anteriores, para informar un error, usted puede usar el issue tracker (recomendado), foros del proyecto o mi \r\ncorreo personal.\r\n\r\nPor favor, indique su versi?n de JRE y de su sistema operativo y adjunte el archivo app.log (el cual est? en la carpeta de \r\nFreeRapid) esto puede ayudarnos a reconocer el problema. Usted puede Ayudarnos tambien si ejecuta la aplicaci?n con el \r\nparametro --debug. Siempre ignoramos preguntas como \"No puedo ejecutar FRD. ?Qu? puedo hacer?\". Describa su situaci?n y el comportamiento de la aplicaci?n \r\n\r\nissue tracker: http://bugtracker.wordrider.net/\r\nforos: http://wordrider.net/forum/list.php?7\r\nmail: bugs@wordrider.net (su correo puede ser atrapado por el filtro antispam, as? que NO considere esta como la mejor forma)\r\n\r\n\r\nVII.    Donaciones\r\n=======================================\r\nFreeRapid Downloader es distribuido como freeware, pero si desea expresar su apreciaci?n por el tiempo y recursos que el\r\nautor ha utilizado desarroll?ndolo, lo aceptaremos y aceptamos donaciones monetarias.\r\nSomos estudianes y debemos pagar nuestro hosting, la cuenta para nuestras novias etc...\r\n\r\nPayPal: http://wordrider.net/freerapid/paypal\r\n   o\r\nuse el n?mero de cuenta descrito en nuestra p?gina  http://wordrider.net/freerapid/\r\n\r\n\r\nVIII.   Preguntas Frecuentes\r\n=======================================\r\nQ: ?Por qu? cre? otro \"RapidShare Downloader\"?\r\nA: 1) Por que no quiero depender de un software ruso que probablemente est? lleno de malware y spyware.\r\n   2) Por que puedo simplemente solucionar las descargas autom?ticas por m? mismo\r\n   3) Por que otros programas existentes tienen interfaces poco intuitivas y pierden caracter?sticas importantes.\r\n   4) Por que Puedo.\r\n\r\nQ: ?C?mo puedo habilitar el soporte para comandos de apagado en Linux y MacOS?\r\nA: Por favor, vea el archivo de configuraci?n \'syscmd.properties\' en el directorio de la aplicaci?n para m?s detalles.\r\n\r\n',	'2016-07-28',	0,	'33501cf8aa1c19bc7af3cb289dfa1fb4',	3,	'txt',	2),
(60,	'c:\\\\Users\\Lubos\\Documents\\FreeRapid-0.9u4\\doc\\readme.fr.txt',	'readme.fr',	'**************************************************************\r\n*   FreeRapid Downloader                                     *\r\n*      by Ladislav Vitasek aka Vity                          *\r\n*   Website/Forum/Bugtracker: http://wordrider.net/freerapid *\r\n*   Mail: info@wordrider.net - suggestions                   *\r\n*   Last change: 20th December 2008                          *\r\n**************************************************************\r\n\r\n=======================================\r\nTable des matióres :\r\n   I.   Qu\'est-ce que FreeRapid Downloader?\r\n  II.   Configuration requise\r\n III.   Comment lancer FreeRapid Downloader\r\n  IV.   Problómes connus et limitations\r\n   V.   Diagnostic\r\n  VI.   Reporter un bug\r\n VII.   Faire un don\r\nVIII.   FAQ\r\n=======================================\r\n\r\n\r\nI.    Qu\'est-ce que FreeRapid Downloader?\r\n=======================================\r\n\r\nFreeRapid downloader est un simple téléchargeur en Java destiné au téléchargement d\'archives de fichers partagés comme RapidShare.\r\n\r\nCaractéristiques principales :\r\n - support pour des téléchargements parallóles de multiples services\r\n - téléchargement via une liste de proxy\r\n - historique de téléchargement\r\n - surveillance intelligente du Presse-Papiers\r\n - vérification automatique de l\'existence d\'un fichier sur le serveur\r\n - mises à jour automatique des plugins\r\n - reconnaissance de CAPTCHA simple\r\n - extinction automatique\r\n - beaucoup de réglages de l\'UI.\r\n - tourne sous MS Windows, OS X et Linux\r\n - est magnifique (beaucoup de thómes de couleur)\r\n - ça fonctionne!\r\n\r\nDiv.:\r\n - Glisser&Déposer d\'URLs\r\n - Interface de programmation (API) simple pour l\'ajout d\'autres services comme des plugins\r\n\r\nServices supportés actuellement (par ordre alphabétique) :\r\n - 2shared.com	             - jandown.com	             - share-rapid\r\n - 4shared.com	             - kewlshare.com	         - shareator.com\r\n - badongo.com	             - kitaupload.com	         - shareonline.biz\r\n - bagruj.cz	             - leteckaposta.cz	         - storage.to\r\n - bitroad.net	             - letitbit.net	             - stream.cz\r\n - cobrashare.sk	         - linkbucks.com	         - subory.sk\r\n - czshare.com	             - load.to	                 - tinyurl.com\r\n - czshare.com_profi	     - mediafire.com	         - ugotfile.com\r\n - dataup.de	             - megaupload.com	         - uloz.cz\r\n - depositfiles.com	         - myurl.in	                 - uloz.to\r\n - disperseit.com	         - nahraj.cz	             - ulozisko.sk\r\n - easyshare.com	         - netgull.com	             - ultrashare.net\r\n - edisk.cz	                 - netload.in	             - uploadbox.com\r\n - egoshare.com	             - o2musicstream.cz	         - uploaded.to\r\n - enterupload.com	         - paid4share.com	         - uploading.com\r\n - filebase.to	             - plunder.com	             - uploadjockey.com\r\n - filefactory.com	         - przeklej.pl	             - upnito.sk\r\n - fileflyer.com	         - quickshare.cz	         - uppit.com\r\n - filesend.net	             - radikal.ru	             - usercash.com\r\n - fileupload.eu	         - RapidShare.com	         - webshare.net\r\n - flyshare.cz	             - RapidShare.com_premium	 - wiiupload.net\r\n - hellshare.com	         - rapidshare.de	         - wikiupload.com\r\n - hellshare.com_full	     - rapidshareuser	         - xtraupload.de\r\n - hotfile.com	             - rsmonkey.com	             - yourfiles.biz\r\n - ifile.it	                 - savefile.com	             - youtube.com\r\n - imagebam.com	             - saveqube.com	             - ziddu.com\r\n - imagehaven.net	         - sdilej.to	             - zippyshare.com\r\n - indowebster.com	         - sendspace.com	         - zshare.net\r\n - iskladka.cz	             - sendspacepl.pl\r\n\r\n -  d\'autres arrivent...\r\nNote: Cette liste pourrait ne pas ôtre actuelle - la plus récente se trouve sur http://wordrider.net/freerapid/\r\n\r\n II.    Configuration requise\r\n=======================================\r\n\r\nConfiguration recommandée :\r\n    * Systóme d\'exploitation Windows 2000/XP/Vista/7/Linux(kernel 2.4)* ou mieux\r\n    * Processeur Pentium 800MHz\r\n    * Résolution d\'écran min 1024x768\r\n    * 40 Mo de RAM libre\r\n    * 10 Mo d\'espace disque libre\r\n    * Java 2 Platform - version 1.6 (Java SE 6 Runtime), au moins, installée\r\n\r\nL\'application a besoin de Sun Java 6.0 au moins pour démarrer (http://java.sun.com/javase/downloads/index.jsp , JRE 6).\r\n\r\nLes utilisateurs d\'un Linux Debian-like peuvent utiliser cette commande pour installer Java :\r\n   sudo apt-get install sun-java6-jre\r\n\r\nIII.   Comment lancer FreeRapid Downloader\r\n=======================================\r\n\r\nInstallation\r\n------------\r\nExtraire les fichiers n\'importe oÿ, évitez les caractóres spéciaux (par exemple \'+\' ou \'!\') dans le chemin.\r\nSi vous faites une mise à jour vers une version plus récente, vous pouvez effacer le dossier précédent. Les préférences utilisateur seront conservées. Ces derniers sont en effet sauvegardées dans les répertoires suivants :\r\nMS Windows: c:\\Documents and Settings\\VOTRE_NOM_D_UTILISATEUR\\application data\\VitySoft\\FRD\r\n\r\nLinux: ~/.FRD\r\n\r\nNE COPIEZ PAS une nouvelle version sur une ancienne. Effacez toujours l\'ancien dossier avant.\r\n\r\n\r\nLancement\r\n-----------\r\nWindows\r\n Lancez simplement frd.exe ou double-cliquez sur frd.jar\r\n\r\n\r\nLinux\r\n Lancez la commande ./frd.sh\r\n (n\'oubliez pas de rendre le fichier exécutable avant)\r\n\r\n\r\nToutes plate-formes\r\n Lancez la commande java -jar frd.jar\r\n\r\n\r\nLes paramótres additionnels de lancement sont :\r\n\r\njava -jar frd.jar [-h -v -d -r -D<property>=<value> -m -p]\r\n\r\noptions\r\n  -h (--help,-?)      affiche ce message\r\n  -v (--version)      affiche les informations de version et quitte\r\n  -d (--debug)        affiche des informations de debogage\r\n  -r (--reset)        remet les propriétés utilisateur à zéro\r\n  -m (--minim)        minimise la fenôtre principale au démarrage\r\n  -Dproperty=value    passe les propriétés et leurs valeurs à l\'application (utilisé principalement à des fins de test et de débogage)\r\n  -p (--portable)     les fichiers de configuration seront stockés dans le dossier \'config\', et tous les chemins de fichiers seront sauvegardés par rapport au dossier FRD, si possible (utile pour les clés USB)\r\n\r\nSi la valeur de l\'option -D est \'default\' (sans les \'), la valeur par défaut sera utilisée.\r\n\r\nExemple - lancement de l\'application en mode de débogage :\r\n  Windows OS: frd.exe --debug\r\n  Linux/MacOS: java -jar frd.jar --debug\r\n\r\n\r\nPlus d\'infos :\r\n  - Tutoriel non-officiel pour les utilisateurs Linux - Comment configurer FreeRapid Downloader sous Linux (en espagnol)\r\n    http://manualinux.my-place.us/freerapid.html\r\n    \r\n\r\nIV.    Bugs connus et limitations\r\n=======================================\r\n- L\'application ne démarre pas si elle est placée sur un chemin contenant des caractóres spéciaux (\'+\', \'%\',...)\r\n  - Merci de la déplacer vers un endroit dépourvu de ces caractóres.\r\n- L\'antivirus ESET \"Smart\" sur Windows bloque le démarrage de FRD\r\n  - Paramétrez correctement votre programme antivirus, ou lancez FRD de cette manióre : frd.exe -Doneinstance=false\r\n- Fermez toujours FRD de manióre propre et correcte, sans quoi vous pourriez perdre votre liste de fichiers (i.e. n\'éteignez pas brutalement votre ordinateur)\r\n- La sélection de \"haut en bas\" dans le tableau principal disparait partiellement pendant un déplacement de la fenôtre :-(\r\n    X Selectionnez les colonnes du tableau par ctrl+clic gauche ou sélectionnez les items de bas en haut.\r\n- Substance look and feel throws org.jvnet.substance.api.UiThreadingViolationException:\r\n                                                     Component creation must be done on Event Dispatch Thread\r\n    X ignorez cette exception dans le app.log\r\n- java.lang.UnsupportedClassVersionError exception\r\n    X Vous utilisez une vieille version de Java, vous devriez utiliser Sun Java Version 6 ou plus récent\r\n- DirectoryChooser throws java.lang.InternalError ou fige sous Windows Vista (64bit)\r\n    X ignorez cette exception dans le app.log\r\n- java.lang.ClassCastException: java.awt.TrayIcon cannot be cast to java.awt.Component\r\n    X ignorez cette exception dans le app.log    \r\n- Des utilisateurs Linux ont reporté que l\'icône dans le tableau de bord qui ne s\'affichait pas\r\n    X La seule solution connue pour ce problóme pourrait ôtre une mise-à-jour de JRE vers la version 1.6.0_10-rc ou plus récent\r\n- limitation: la version 0.7x n\'est pas utilisable à partir du moment oÿ vous utilisez la version 0.8 ou plus récent (la seule solution possible est de supprimer les anciens fichiers de configuration)\r\n\r\nV.    Diagnostic\r\n=======================================\r\n1. Vérifiez la section IV - pour voir si votre problóme ne figure pas déjà dedans\r\n2. Avez-vous essayé de redémarrer l\'application? :-)\r\n3. Vérifiez le site http://wordrider.net/freerapid et/ou http://bugtracker.wordrider.net/\r\n   pour d\'éventuels nouveaux bugs connus\r\n4. Vous pouvez essayer de supprimer les fichiers de configuration (leur emplacement est décrit dans la section III - Installation)  \r\n5. Lancez l\'application en mode de déboguage :\r\n   Windows OS: frd.exe --debug\r\n   Linux/MacOS: java -jar frd.jar --debug\r\n6. Reportez le problóme avec app.log comme décrit dans la section VI\r\n\r\n\r\nVI.    Reporter un bug\r\n=======================================\r\nSi vous trouvez un bug, merci de ne pas supposer que je le connais. Informez m\'en aussitôt que possible, afin que je puisse le résoudre avant la version suivante. \r\nEtant donné que mes ressources sont limitées, je ne peux rétro-porter les résolutions de bug sur des anciennes versions.\r\nPour reporter un bug, vous pouvez utiliser le tracker de bug (recommandé), les forums du projet, ou mon e-mail personnel (en anglais).\r\n\r\nMerci de préciser votre systóme d\'exploitation, sa version ainsi que celle de votre JRE, et de joindre le fichier app.log (qui se trouve dans le dossier de FRD).\r\nIl peut nous aider à reconnaitre un problóme. Vous pouvez également nous aider en lançant l\'application avec le paramótre --debug.\r\nNous ignorons les reports simple du style \"Je ne peux lancer FRD. Que dois-je faire?\". Décrivez votre situation et le comportement de l\'application. Soyez précis.\r\n\r\n\r\nissue tracker: http://bugtracker.wordrider.net/\r\nforum: http://wordrider.net/forum/list.php?7\r\nmail: bugs@wordrider.net (votre mail peut ne jamais arriver à destination à cause des filtres anti-spam, cette voie n\'est par conséquent PAS recommandée!)\r\n\r\n\r\nVII.    Faire un don\r\n=======================================\r\nFreeRapid downloader est distribué en tant que gratuiciel (freeware), mais si vous voulez exprimer votre appréciation pour le temps et les ressources que l\'auteur a investi dans le développement de ce logiciel, nous acceptons et apprécions les dons financiers.\r\nNous sommes des étudiants, et devons payer pour l\'hébergement web, les factures de nos copines, etc...\r\n\r\nPayPal: http://wordrider.net/freerapid/paypal\r\n   ou\r\nUtilisez le compte bancaire décrit sur notre page d\'accueil : http://wordrider.net/freerapid/donation.html\r\n\r\n\r\nVIII.   FAQ\r\n=======================================\r\n\r\nQ: Pourquoi avez-vous créé un autre \"RapidShare Downloader\"?\r\nA: 1) Parce que je ne veux pas ôtre dépendant d\'un logiciel russe probablement plein de malware et autres spywares.\r\n   2) Parce que je peux simplement régler des téléchargements automatisés moi-môme.\r\n   3) Parce que d\'autres téléchargeurs existants ont des interfaces utilisateurs peu intuitives, et/ou manquent de fonctionnalités importantes.\r\n   4) Parce que je peux le faire.\r\n\r\nQ: Comment activer un support pour des commandes au démarrage/à l\'extinction sur Linux et MacOS?\r\nA: Merci de lire le fichier de configuration \'syscmd.properties\' dans le dossier de l\'application pour plus de détails.\r\n\r\nQ: Oÿ sont situés les fichiers de configuration?\r\nA: Cf. section III/Installation.\r\n\r\nQ: Comment utiliser un compte RapidShare Premium?\r\nA: Par défaut, un plugin RapidShare Free est utilisé.\r\nPour utiliser un compte premium, allez à Options>Préférences>Plugins>Settings, trouvez le plugin Rapidshare_premium et activez-le.\r\nPour entrer les informations de login, cliquez sur \"Options\". Entrez-les et cliquez sur \"OK\" pour confirmer.\r\n\r\nSeules les ID de comptes numériques sont supportés. Les autres types de plugins premium ne sont pas encore implémentés.\r\n\r\nQ: Utilisateurs Windows : Comment lancer le programme en ligne de commande?\r\nA: Allez à Démarrer>Exécuter... et tapez :\r\ncmd ENTER\r\ncd path_to_freerapid_directory\' ENTER\r\nfrd.exe ENTER\r\n\r\nSi vous avez besoin d\'entrer des paramótres, utilisez par exemple \"frd.exe --portable\"\r\n',	'2016-07-28',	0,	'2b740a7460cbc1914a5a29637cd6f887',	3,	'txt',	2),
(61,	'c:\\\\Users\\Lubos\\Documents\\FreeRapid-0.9u4\\doc\\readme.hr.txt',	'readme.hr',	'﻿?**************************************************************\r\n*   FreeRapid Downloader                                     *\r\n*      by Ladislav Vitasek aka Vity                          *\r\n*   Website/Forum/Bugtracker: http://wordrider.net/freerapid *\r\n*   Mail: info@wordrider.net - suggestions                   *\r\n*   Last change: 20th December 2008                          *\r\n**************************************************************\r\n\r\n=======================================\r\nSadržaj:\r\n   I.   Što je FreeRapid Downloader\r\n  II.   Zahtjev Sistema\r\n III.   Kako pokrenuti FreeRapid\r\n  IV.   Poznati problemi i ograničenja\r\n   V.   Rješavanje problema\r\n  VI.   Prijava Bugova\r\n VII.   Donacije\r\nVIII.   FAQ (pitanja i odgovori)\r\n=======================================\r\n\r\n\r\nI.    Što je FreeRapid Downloader\r\n=======================================\r\n\r\nFreeRapid downloader je jednostavan Java downloader koji podržava preuzimanje s Rapidshare-a i drugih file share arhiva.\r\n\r\nGlavne osobine:\r\n - Podržava istodobno preuzimanje sa više servisa\r\n - preuzimanje koristeći proxy listu\r\n - povijest preuzimanja\r\n - pametno praćenje sistemskog spremnika\r\n - automatska provjera postojanja datoteke na serveru\r\n - automatska nadogradnja pluginova\r\n - jednostavno CAPTCHA prepoznavanje\r\n - automatsko gašenje\r\n - puno UI postavki \r\n - radi na MS Windowsima, Linuxu and MacOS-u\r\n - očaravajući izgled (puno šarenih stilova)\r\n - jednostavno - radi!\r\n\r\nMisc.:\r\n - Drag&Drop URL-ova\r\n - lak programming interface (API) za dodavanje drugih servisa kao pluginova\r\n\r\nTrenutačno podržani servisi su (abecednim redom):\r\n - 2shared.com	             - jandown.com	             - share-rapid\r\n - 4shared.com	             - kewlshare.com	         - shareator.com\r\n - badongo.com	             - kitaupload.com	         - shareonline.biz\r\n - bagruj.cz	             - leteckaposta.cz	         - storage.to\r\n - bitroad.net	             - letitbit.net	             - stream.cz\r\n - cobrashare.sk	         - linkbucks.com	         - subory.sk\r\n - czshare.com	             - load.to	                 - tinyurl.com\r\n - czshare.com_profi	     - mediafire.com	         - ugotfile.com\r\n - dataup.de	             - megaupload.com	         - uloz.cz\r\n - depositfiles.com	         - myurl.in	                 - uloz.to\r\n - disperseit.com	         - nahraj.cz	             - ulozisko.sk\r\n - easyshare.com	         - netgull.com	             - ultrashare.net\r\n - edisk.cz	                 - netload.in	             - uploadbox.com\r\n - egoshare.com	             - o2musicstream.cz	         - uploaded.to\r\n - enterupload.com	         - paid4share.com	         - uploading.com\r\n - filebase.to	             - plunder.com	             - uploadjockey.com\r\n - filefactory.com	         - przeklej.pl	             - upnito.sk\r\n - fileflyer.com	         - quickshare.cz	         - uppit.com\r\n - filesend.net	             - radikal.ru	             - usercash.com\r\n - fileupload.eu	         - RapidShare.com	         - webshare.net\r\n - flyshare.cz	             - RapidShare.com_premium	 - wiiupload.net\r\n - hellshare.com	         - rapidshare.de	         - wikiupload.com\r\n - hellshare.com_full	     - rapidshareuser	         - xtraupload.de\r\n - hotfile.com	             - rsmonkey.com	             - yourfiles.biz\r\n - ifile.it	                 - savefile.com	             - youtube.com\r\n - imagebam.com	             - saveqube.com	             - ziddu.com\r\n - imagehaven.net	         - sdilej.to	             - zippyshare.com\r\n - indowebster.com	         - sendspace.com	         - zshare.net\r\n - iskladka.cz	             - sendspacepl.pl\r\n\r\n\r\nPrimjedba: Ova lista možda nije aktualna - Trenutačnu listu možete pronaći na http://wordrider.net/freerapid/\r\n\r\n II.    Zahtjev Sistema\r\n=======================================\r\n\r\nPreporučena konfiguracija:\r\n    * Windows 2000/XP/Vista/7/Linux(core 2.4)* ili noviji operativni sistem\r\n    * Pentium 800MHz procesor\r\n    * min 1024x768 rezolucija ekrana\r\n    * 40 MB slobodne RAM memorije\r\n    * 10 MB slobodnog mjesta na disku\r\n    * Java 2 Platforma - verzija najmanje 1.6 (Java SE 6 Runtime) instalirana\r\n\r\nAplikacija zahtjeva najmanje Sun Java 6.0 za pokretanje (http://java.sun.com/javase/downloads/index.jsp , JRE 6).\r\n\r\nLinux Debian korisnici mogu upotrijebiti ovu komandu da bi instalirali Javu:\r\n   sudo apt-get install sun-java6-jre\r\n\r\nIII.   Kako pokrenuti FreeRapid?\r\n=======================================\r\n\r\nInstalacija\r\n------------\r\nRazipujte datoteke u bilo koju mapu, ali ne koristite specijalne karaktere (kao \'+\' ili \'!\') u putanji.\r\nAko radite nadogradnju na višu verziju, možete obrisati prethodnu mapu. Sve korisničke postavke su sačuvane. Sve korisničke postavke su pohranjene u mapama:\r\nMS Windows: c:\\Documents and Settings\\YOUR_USER_NAME\\application data\\VitySoft\\FRD\r\n\r\nLinux: ~/.FRD\r\n\r\nNEMOJTE prepisati novu verziju preko stare.\r\n\r\n\r\nPokretanje\r\n-----------\r\nWindows\r\n Jednostavno pokrenite frd.exe ili dvostruki klik na frd.jar\r\n\r\n\r\nLinux\r\n Pokrenite komandu ./frd.sh\r\n (najprije postavite ispravna izvršna prava nad ovom datotekom )\r\n\r\n\r\nSve platforme\r\n Pokrenite komandu java -jar frd.jar\r\n\r\ndodatni parametri za pokretanje su:\r\n\r\njava -jar frd.jar [-h -v -d -r -D<svojstva>=<vrijednost> -m -p]\r\n\r\nopcije\r\n  -h (--help,-?)      prikazuje ovu poruku\r\n  -v (--version)      prikazuje informaciju o verziji i izlazi\r\n  -d (--debug)        prikazuje debuging informaciju\r\n  -r (--reset)        postavlja korisničke postavke na početne vrijednosti  \r\n  -m (--minim)        minimizira glavni prozor ns startu  \r\n  -Dsvojstva=vrijednost    dodaje svojstva i vrijednosti aplikaciji (najčešće za debugiranje ili za testiranje)\r\n  -p (--portable)     konfiguracijske datoteke biti će spremljene u \'config\'\r\n                      mapu, sve putanje datoteka biti će spremljene u odnosu s FRD\r\n                      mapom (ako je moguće) - korisno za USB FLASH drive\r\n\r\nAko je vrijednost opcije -D namještena na \'default\' (bez \') biti će korištene početne postavke.\r\n\r\nPrimjer - Pokretanje aplikacije u debug modu:\r\n  Windows OS: frd.exe --debug\r\n  Linux/MacOS: java -jar frd.jar --debug\r\n\r\n\r\nJoš Informacija:\r\n  - Nezvanični tutorijal za Linux korisnike - kako konfigurirati FreeRapid Downloader na Linux (na Španjolskom)\r\n    http://manualinux.my-place.us/freerapid.html\r\n    \r\n\r\nIV.    Poznati problemi i ograničenja\r\n=======================================\r\n- Aplikacija se neće pokrenuti ako je smještena u putanji sa posebnim znakovima kao \'+\' ili \'%\'\r\n  - X molimo premjestite aplikaciju na drugu lokaciju bez takvih znakova\r\n- ESET \"Smart\" Antivirus na Windows OS-u spriječava pokretanje FRD-a\r\n  - X postavite vaš antivirusni program ili pokrenite FRD na ovaj način: frd.exe -Doneinstance=false\r\n- Uvijek izlazite iz FRD-a normalno inače možete izgubiti listu datoteka (npr. Windows gašenje sa force opcijom...)          \r\n- odabir od \"vrha do dna\" u glavnoj tablici u toku odvlačenja preuzimanjedjelimično nestane :-(\r\n    X odaberite tablične redove s ctrl+klik mišem ili odaberite od dna do vrha\r\n- Suština izgleda i osjećaja vraća org.jvnet.substance.api.UiThreadingViolationException:\r\n                                                     Component creation must be done on Event Dispatch Thread\r\n    X ignorirajte ovaj exception u app.log\r\n- java.lang.UnsupportedClassVersionError exception\r\n    X Koristite stariju Java verziju, trebate koristiti Sun Java verziju 6 ili noviju\r\n- DirectoryChooser throws java.lang.InternalError ili zaledi na Win Vista (64bit)\r\n    X ignorirajte ovaj exception u app.log\r\n- java.lang.ClassCastException: java.awt.TrayIkona ne može biti postavljena java.awt.Component\r\n    X ignorirajte ovaj exception u app.log    \r\n- Linux korisnici prijavljuju da se ne prikazuje tray ikona u Linux-u\r\n    X jedino poznato rješenje ovog problema može biti nadogradnja JRE u verziju 1.6.0_10-rc ili noviju\r\n- ograničenja: verzija 0.7x je neupotrebljiva ako koristite verziju 0.8 ili noviju (jedino moguće rješenje je je da uklonite konfiguracijske datoteke)\r\n\r\nIV.    Rješavanje problema\r\n=======================================\r\n1. Provjerite odlomak IV - za već poznate bugove i ograničenja\r\n2. Jeste li probali ugasiti i ponovno pokrenuti aplikaciju? :-)\r\n3. Provjerite web stranicu http://wordrider.net/freerapid i/ili problem traker at http://bugtracker.wordrider.net/\r\n   za mogući poznati bug\r\n4. Možete probati obrisati konfiguracijske datoteke (njihova lokacija je opisana u odlomku VI - (Instalacija )  \r\n5. Pokrenite aplikaciju u debug modu:\r\n   Windows OS: frd.exe --debug\r\n   Linux/MacOS: java -jar frd.jar --debug\r\n6. prijavite problem s app.log kao što je opisano u odlomku VI\r\n\r\n\r\nVI.    Prijava Bugova\r\n=======================================\r\nAko primjetite bug, molim vas nemojte pretpostaviti da znam za njega. Obavijestite me što je prije moguće kako bih to mogao popraviti prije izlaska\r\nslijedeće verzije. Kako su moji resursi ograničeni,ne mogu podržati ispravak Bugova u ranijim verzijama.\r\nKako bi prijavili bug, možete koristiti issue tracker (preporučljivo), forums o projektu ili moj osobni e-mail.\r\n\r\nMolim prijavite Vaš JRE i OS verziju i pridodajte datoteku app.log (koja je smještena u FreeRapid mapi).\r\nMožete i pomoći da pronađemo problem. Također možete pomoći ako pokrenete aplikaciju s  --debug parametrom.\r\nNe uzimamo u obzir jednostavna izvješća kao \"Ne mogu pokrenuti FRD. Što da radim?\". Opišite vaš problem i ponašanje aplikacije.\r\n\r\n\r\nissue tracker: http://bugtracker.wordrider.net/\r\nforum: http://wordrider.net/forum/list.php?7\r\nmail: bugs@wordrider.net (Vaša mail poruka može biti uhvaćena u spam filter, tako da tim putem NIJE preporučeno!)\r\n\r\n\r\nVII.    Donacije\r\n=======================================\r\nFreeRapid downloader se distribuira kao freeware, ali ako želite izraziti svoju zahvalnost za vrijeme i resurse autoru koje je utrošio u razvoj, prihvaćaju se novčane donacije.\r\nMi smo studenti i moramo platiti za webhosting, računi za naše djevojke itd...\r\n\r\nPayPal: http://wordrider.net/freerapid/paypal\r\n   ili\r\nkoristite račun banke opisan na homepage-u\r\nhttp://wordrider.net/freerapid/donation.html\r\n\r\n\r\nVIII.   FAQ (pitanja i odgovori)\r\n=======================================\r\n\r\nQ: Zašto ste stvorili još jedan \"RapidShare Downloader\"?\r\nA: 1) zato što nisam htio biti ovisan o ruskom softveru, koji je najvjerojatnije pun of malware-a i spyware-a.\r\n   2) Zato što jednostavno sam mogu napraviti automatski downloader.\r\n   3) Zato što drugi postojeći downloaderi imaju nemaštovito korisničko sučelje i fale im važne funkcije.\r\n   4) Zato što mogu.\r\n\r\nQ: Kako omogućiti podršku za gašenje/restart komande na Linuxu i MacOSu?\r\nA: Molim pogledajte \'syscmd.properties\' konfiguracijsku datoteku u mapi aplikacije za više detalja.\r\n\r\nQ: Gdje su smještene konfiguracijske datoteke?\r\nA: Vidi odlomak o Instalaciji.\r\n\r\nQ: Kako postaviti Rapidshare Premium account?\r\nA: Free Rapidshare plugin se koristi kao početni.\r\nZa korištenje premium accounta idite na Opcije->Postavke->Pluginovi->panel postavki, onda pronađite Rapidshare_premium plugin i aktivirajte ga (klik na kvadratić u prvoj koloni- X).\r\nKako bi postavili vaše login podatke kliknite na gumb Opcije. Potvrdite detalje o accountu\r\ns OK gumbom.\r\n\r\nSamo brojčani account ID je podržan. Ostali premium pluginovi još nisu implementirani.\r\n\r\nQ: Windows korisnici: Kako pokrenuti program iz komandne linije?\r\nA: Idite na Start->Run i otipkajte:\r\ncmd ENTER\r\ncd putanja_u_freerapid_mapu\' ENTER\r\nfrd.exe ENTER\r\n\r\nAko trebate unijeti neke paremetre, koristite npr. frd.exe --portable',	'2016-07-28',	0,	'36deffca6c0a7d1dce35e2e3105e2b23',	3,	'txt',	2),
